import React, { useState } from 'react';
import './styles.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Menu, Icon } from 'antd';
import { DashboardOutlined, UnorderedListOutlined, CodepenOutlined, UsergroupAddOutlined } from '@ant-design/icons';

const SubMenu = Menu.SubMenu;

const SiderComponent = () => {
    const [state, setState] = useState(false);

    return (
        <div className="sider">
            <Menu defaultSelectedKeys={['1']} mode="inline">
                <Menu.Item key="1">
                    <DashboardOutlined />
                    <span>Tổng quan</span>
                    <Link to="/" />
                </Menu.Item>
                <Menu.Item key="2">
                    <UnorderedListOutlined />
                    <span>Danh mục</span>
                    <Link to="/meseros" />
                </Menu.Item>
                <Menu.Item key="2">
                    <CodepenOutlined />
                    <span>Sản phẩm của tôi</span>
                    <Link to="/meseros" />
                </Menu.Item>
                <Menu.Item key="2">
                    {/* <Icon type="desktop" /> */}
                    <span>Đơn hàng</span>
                    <Link to="/meseros" />
                </Menu.Item>
                <Menu.Item key="2">
                    <UsergroupAddOutlined />
                    <span>Thành viên</span>
                    <Link to="/meseros" />
                </Menu.Item>
            </Menu>
        </div>
    )
}
export default SiderComponent;
